  \"2016-04-06T23:21:44.861013\",\n\t\"name\": \"health-data-interactive-hdi\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Health Data Interactive (HDI) presents
  a broad range of important public health indicators through an interactive web-based
  application that provides access to pre-tabulated national and state data for the
  US.   The primary objective is to provide national estimates of public health measures
  cross tabulated by a common set of variables.   HDI tables contain national health
  statistics for infants, children, adolescents, adults, and older adults.   The tables
  can be customized by age, gender, race/ethnicity, and geographic location to explore
  different trends and patterns.n</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
